import React,{Component} from 'react';

export class Todo extends Component {

    constructor(props) {
        super(props);
    }   

    render() {
        return ( 
            <div>
                <p> {"Text: " + this.props.text} </p>
                <p> {"Priority: " + this.props.priority} </p>
                <p> {"DueDate: " + this.props.dueDate.toString()} </p>
	        </div> 
        );
    }
}
export default Todo;
